def main():
    inputString = ''

    partOneCharacterTracker = ''
    partTwoCharacterTracker = ''

    for i in range(len(inputString)):
        if len(partOneCharacterTracker) < 4:
            partOneCharacterTracker += inputString[i]
            continue

        partOneCharacterTracker = partOneCharacterTracker[1:] + inputString[i]

        if len(partOneCharacterTracker) == len(set(partOneCharacterTracker)) and len(partOneCharacterTracker) == 4:
            print('Part 1: ' + partOneCharacterTracker, i + 1)
            break

    for i in range(len(inputString)):
        if len(partTwoCharacterTracker) < 14:
            partTwoCharacterTracker += inputString[i]
            continue

        partTwoCharacterTracker = partTwoCharacterTracker[1:] + inputString[i]

        if len(partTwoCharacterTracker) == len(set(partTwoCharacterTracker)) and len(partTwoCharacterTracker) == 14:
            print('Part 2: ' + partTwoCharacterTracker, i + 1)
            break



if __name__ == "__main__":
    main()